//                  MAKING BACK-END DEVELOPER LIST PROFILE'S COMPONENT                 \\

    // Importing Requried Modules :
import React from 'react';

    // Importing Requried Component :
import Pro from './Profile';

    // Importing Array that contain all Profiles Data :
import ProfileData from "./ProfileData";

function Back() {
    return (
        <>
            <Pro
                proname={ProfileData[2].proname}
                proimg={ProfileData[2].proimg}
                prolink={ProfileData[2].prolink}
                proexpert={ProfileData[2].proexpert}
            />
            <Pro
                proname={ProfileData[3].proname}
                proimg={ProfileData[3].proimg}
                prolink={ProfileData[3].prolink}
                proexpert={ProfileData[3].proexpert}
            />
        </>
    )
};


    // Exporting Component :
export default Back;
